define('js/build/config',[
    'underscore',
    'json!../../../gemini.json',
    'json!../../../gemini.user.json'
  ], function(_, coreSettings, projectSettings){

  return {
    configModules: function(vendorPath){
      if (_.isUndefined(vendorPath)) vendorPath = 'bower_components/';

      //Setup the settings to work the same as the gruntfile build
      // Point core paths to the components directory
      coreSettings.paths = _.object(_.map(coreSettings.paths, function(location, name){
        return [name, vendorPath + location];
      }));

      var geminiSettings = _.extend(
        coreSettings,
        projectSettings,
        //Deep copy paths and shim
        {
          paths: _.extend(coreSettings.paths, projectSettings.paths),
          shim: _.extend(coreSettings.shim, projectSettings.shim)
        }
      );

      require.config({
        paths: geminiSettings.paths,
        shim: geminiSettings.shim
      });
    }
  };

});

/*
 * Needed for development include
 */
require.config({
  baseUrl: '/dist/'
});

require(['js/build/config'], function(config){

  config.configModules();

  require(['js/pages/main'], function($){
    //Get the page to load
    var page = $('script[data-page]').data('page');

    //Load the page
    if (page!==undefined && page.length) require([ 'js/pages/' + page ]);
  });

});

